import { Box, Container, styled, Typography } from "@mui/material";
import React from 'react'
import { Data } from "../StaticData/data";
import CustomCard from '../components/CustomCard';

const Dishes= () => {
    const DishesBox = styled(Box)(({ theme }) =>({
     display: "flex",
     justifyContent: "space-between",
     marginTop: theme.spacing(5),
     [theme.breakpoints.down("md")]: {
        flexDirection: "column",
        alignitems: "center",
     },
    }));

  const PropertiesTextBox = styled(Box)(({ theme }) => ({
  [theme.breakpoints.down("md")]: {
    textAlign: "center",
  },
  }));
 return (
  <Box sx={{ mt: 5, backgroundColor: "#F5FAFE", py: 10 }}>
   <Container>
   <PropertiesTextBox>
    <Typography
     sx={{ color:"#000339", fontSize:"35px", fontWeight:"bold",m1:"13px" }}
      >
       Featured Dishes
    </Typography>
    <Typography sx={{ color:"#5A6473", fontSize:"16px", mt: 1,m1:"13px"}}>
       Explore Variety of South Indian Dishes!!
    </Typography>
   </PropertiesTextBox> 

   <DishesBox>
    {Data.map((foodItem)=>(
        <CustomCard
        key={foodItem.id}
        img={foodItem.img}
        price={foodItem.price}
        item={foodItem.item}
        likes={foodItem.likes}
        heart={foodItem.heart}
        share={foodItem.share}
        />
    ))}
      </DishesBox>
     </Container>
   </Box>
  );
};

export default Dishes;
